int
main(int argc, char **argv)
{
	while (true)
	{
		scanf("%d%d", &H, &W);
		if (H == 0 && W == 0)
			break;

		for (int i = 0; i < H; ++i)
			scanf("%s", &puzzle[i][0]);

		scanf("%d", &n);
		for (int s = 0; s < n; ++s)
		{
			scanf("%d%d", &h0[s][0], &w0[s][0]);
			int h = h0[s][0];
			int w = w0[s][0];

			for (int y = 0; y < h; ++y)
				scanf("%s", &piece[s][0][y][0]);

			h0[s][1] = w;
			w0[s][1] = h;
			for (int y = 0; y < h; ++y)
			{
				for (int x = 0; x < w; ++x)
					piece[s][1][x][h - y - 1] = piece[s][0][y][x];
			}

#ifdef DEBUG
			for (int x = 0; x < w; ++x)
				piece[s][1][x][h] = NUL;
#endif

			h0[s][2] = h;
			w0[s][2] = w;
			for (int y = 0; y < h; ++y)
			{
				for (int x = 0; x < w; ++x)
					piece[s][2][h - 1 - y][w - 1 - x] = piece[s][0][y][x];

#ifdef DEBUG
				piece[s][2][h - 1 - y][w] = NUL;
#endif
			}

			w0[s][3] = h;
			h0[s][3] = w;
			for (int y = 0; y < h; ++y)
			{
				for (int x = 0; x < w; ++x)
					piece[s][3][w - 1 - x][y] = piece[s][0][y][x];
			}

#ifdef DEBUG
			for (int x = 0; x < w; ++x)
				piece[s][3][x][h] = NUL;
#endif
		}

		int p;
		scanf("%d", &p);
		for (int i = 0; i < p; ++i)
		{
			scanf("%d", &k);
			for (int j = 0; j < k; ++j)
			{
				scanf("%d", &t[j]);
				t[j]--;
			}

			printf("%s\n", solve() ? "YES" : "NO");
		}
	}

#ifdef DEBUG
	fprintf(stderr, "O:%d\n", O);
#endif
	return 0;
}
